import { FC } from "react";
import { OrderResponse } from "../types/order-response-type";

type TradeListProps = {
  marketPrice: number;
  tradeList: OrderResponse[];
};

export const TradeList: FC<TradeListProps> = ({ tradeList, marketPrice }) => {
  return (
    <div className="bg-white rounded-md min-h-60 max-h-60 w-full mx-4">
      <div className="flex justify-between p-2 font-bold">
        <p className="min-w-20">Trade</p>
        <p className="min-w-20">Order Type</p>
        <p className="min-w-20">Asset</p>
        <p className="min-w-20">Amount</p>
        <p className="min-w-20">Price</p>
        <p className="min-w-20">Total</p>
      </div>
      <div className="overflow-y-scroll h-4/5 pb-2 px-2">
        {!tradeList.length && (
          <div className="flex justify-center items-center h-full">
            <p className="font-semibold">No Trades</p>
          </div>
        )}
        {tradeList.map((trade, idx) => {
          return (
            <div key={idx} className="flex justify-between p-2 text-sm font-semibold">
                <p
                  className={`min-w-20 max-w-full ${
                    trade.side === "BUY" ? "text-green-500" : "text-red-500"
                  }` }
                >
                  {trade.side}
                </p>
                <p className="min-w-20">{trade.type}</p>
                <p className="min-w-20">{trade.asset}</p>
              
                <p className="min-w-20">{trade.quantity}</p>
              <p className="min-w-20">${trade.type === "LIMIT" ? trade.price : marketPrice}</p>
              <p className="min-w-20">${trade.notional}</p>
            </div>
          );
        })}
      </div>
    </div>
  );
};
